import logo from './applogo.png';
import './App.css';
import Form from './components/Form';
function App() {
  return (
    <div className="App"><Form/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="AppSqaure"></div>
      </header>
    </div>
  );
}

export default App;
